import React from "react";
import Cell from "./Cell";

const Board = (props) => {
  return (
    <div className="game-board">
      {Array(9)
        .fill()
        .map((item, index) => (
          <Cell>{console.log(props.cell)}</Cell>
        ))}
    </div>
  );
};

export default Board;
